import React from "react";
import OfficerCards from "../OfficerCards.js";

const blank = "https://static.vecteezy.com/system/resources/previews/001/921/566/non_2x/businessman-elegant-with-infographic-presentation-free-vector.jpg"

const committee = [
    {
        name: "Isabella King",
        position: "Chair",
        email: "iking4380@sdsu.edu",
        major: "Computer Science",
        photo: require("../../images/officers25/bella.png"),
    },
    {
        name: "Everett Richards",
        position: "Member & ACM President",
        email: "erichards5198@sdsu.edu",
        url: "https://everettrichards.com",
        major: "Computer Science & Applied Math",
        photo: require("../../images/officers25/everett.png"),
    },
    {
        name: "",
        position: "",
        email: "",
        url: "",
        major: "",
        photo: blank,
    },
    {
        name: "Priya Manju Muralidharan",
        position: "Faculty Advisor",
        email: "mmuralidharanpriya@sdsu.edu",
        url: "https://cs.sdsu.edu/people/priya-manju-muralidharan/",
        major: "Lecturer of Computer Science",
        photo: blank,
    },
]

export default function Committee() {
    return (
        <section id="committee" class="pt-6 pb-0 items-center text-white">
            <h1 class="hackheader mb-0">Planning Committee</h1>
            <OfficerCards officers={committee}/>
        </section>
    );
}
